import { Fragment } from "react";
import Header from './header.js'

const Form = ({ header, children }) => { return (
    <Fragment>
        <Header text={ header } />
        <div className={ 'content' }>
            { children }
        </div>
    </Fragment>
)}

const Text = ({ label, value, func }) => { return (
        <input
            value={ value }
            placeholder={ label }
            onChange={ func }
            type={ 'text' }
        />
)}

const Number = ({ label, value, func }) => { return (
        <input
            value={ value }
            placeholder={ label }
            onChange={ func }
            type={ 'number' }
        />
)}

export {
    Form,
    Text,
    Number
}
